import Axios from "axios"

class menulist extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    componentDidMount() {
        Axios.post("/lists", {
            params: {
                id: 1
            }
        }).then((res) => {
            console.log(1);
        })
    }
    render() {
        return (
            <div className="menulist">

            </div>
        );
    }
}

export default menulist;
